          {/* <Route path="/photoupload" component={PhotoUpload} /> */}
          {/* <Route path="/administer" component={Administer} /> */}
          {/* <Route path="/photodetail" component={PhotoDetail} /> */}
          {/* <Redirect from="/*" to="/" /> */}
        </Switch>
      </Router>
    )
  }
}

export default connect()(App)
